import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const Home = () => {
  return (
    <View>
      <Text>Home</Text>
    </View>
  )
}

export default Home

const styles = StyleSheet.create({
  mainContainer: {
    height: "100%",
    display: "flex",
    justifyContent: "space-between",
    textAlign: "center",
    paddingHorizontal: 20,
    backgroundColor: "#fff",
  },
  homeTop: {
    justifyContent: "center",
    alignItems: "center",
    display: "flex",
    paddingHorizontal: 10,
  },
  headerImage: {
   height: undefined,
   width: "100%",
   aspectRatio: 1,
   display: "flex",
   alignItems:"stretch",
   marginTop: 50,
   borderRadius: 20,
  },
  mainHeader: {
    fontSize: 30,
    color: "#344055",
    textTransform: "uppercase",
  },
  paraStyle: {
    textAlign: "left",
    fontSize: 19,
    lineHeight: 26,
    color: "#7d7d7d",
    marginTop: 30,
    marginBottom: 50,
  }
});
